import "./form.scss";
import Button from "../../subComponent/button/button";
import Input from "../../subComponent/input/input";

const Form = () => {
  return (
    <div className="App">
      <form action="" className="form">
        <div className="form__container">
          
          <a href="#" className="step-back">
            <img src="" alt="" />
            Назад
          </a>
        </div>
        {/* <Button></Button>
        <Input></Input> */}
      </form>
    </div>
  );
};

export default Form;
